"""
    Given two words (beginWord and endWord), and a dictionary, find the length of shortest
    transformation sequence from beginWord to endWord, such that:

    Only one letter can be changed at a time
    Each intermediate word must exist in the dictionary
    For example,

    Given:
    start = "hit"
    end = "cog"
    dict = ["hot","dot","dog","lot","log"]
    As one shortest transformation is "hit" -> "hot" -> "dot" -> "dog" -> "cog",
    return its length 5.

    Note:
    Return 0 if there is no such transformation sequence.
    All words have the same length.
    All words contain only lowercase alphabetic characters.
"""
def find_ladders(start, end, d):
    if start == end:
        return 2

    if not start in d:
        d.append(start)
    if not end in d:
        d.append(end)
    return bfs(start, end, Set(d))

def bfs(start, end, d):
    curr_level = Set()
    next_level = Set()
    level = 1
    curr_level.add(start)
    visited = Set()
    while True:
        for s in curr_level:
            for ss in find_next(s, d, visited):
                next_level.add(ss)
        if not next_level:
            return 0
        if end in next_level:
            return level + 1
        curr_level = next_level
        next_level = Set()
        level += 1
    return 0

def find_next(curr, d, visited):
    res = []
    arr = list(curr)
    for i in range(0, len(curr)):
        tmp = arr[i]
        for c in 'abcdefghijklmnopqrstuvwxyz':
            arr[i] = c
            s = ''.join(arr)
            if d != s and s in d and not s in visited:
                res.append(s)
                visited.add(s)
        arr[i] = tmp
    return res


